import React from "react";
import Header from '../componenets/shared/Header';

class Index extends React.Component {
  render() {
    return (
      <React.Fragment>
        <h1>I am from Index Page!</h1>
        <Header/>
      </React.Fragment>
    );
  }
}

export default Index;
